Strategic Educational Consulting (SEDC), LLC provides expert consulting and training services to Federal, State and local government agencies and their private sector clients. Specifically, SEDC delivers services to enhance the emergency preparedness of agency, organization, or company staff and its clients. SEDC also develops and delivers training to people with disabilities on becoming an involved self-advocate and to agency staff on being sensitive to the needs of people with disabilities when providing services.

To this end, SEDC can:
•	Develop and deliver customized trainings;
•	Design training material, forms and assessments;
•	Collect and analyze data to generate reports; 
•	Assess and update existing plans and/or policies; and,
•	Create scenarios and exercises to test contingency plans.
